import React, { Component } from 'react';
import {Card} from 'react-bootstrap';

class Footer extends Component {
    render() {
        return (
            <div>
                <Card>

  <Card.Body>
   
    <Card.Text>
         @2022-Movie Ticket Booking
    </Card.Text>
   
  </Card.Body>
</Card>
            </div>
        );
    }
}

export default Footer;
